import './Login.css'
import secvid from './sechalf/Login2.mp4'

const Login = () => {
    return (
    <div className='MainLogin'>

        <div className='FirstHalf'>
            <form>
                <input type='text'></input>
                <input type='password'></input>
            </form>
        </div>

        <div className='SectHalf'>
        <video
    id="my-player"
    src={secvid}
    className="video-js"
    controls={false}
    muted="muted"
    loop={true}
    autoPlay={true}
    preload="auto"
    data-setup='{}'>
 
</video>
        </div>

    </div>
    );
}
 
export default Login;
